import Link from "next/link";
export default function NavBar() {
	return (
		<nav>
			<p className='text-2xl font-bold'>AAAA</p>
			<div className='flex'>
				<Link href='/'>
					<a
						href='/'
						className='rounded bg-blue-500 hover:bg-blue-600 text-white py-2 px-4'>
						Home
					</a>
				</Link>
			</div>
		</nav>
	);
}
